import {
  Button,
  Popover,
  PopoverBody,
  PopoverHeader,
  UncontrolledPopover,
} from "reactstrap";
import Cart from "./cart";

export default function PopOver() {
  return (
    <div>
      <Button
        id='Popover123'
        type='button'>
        Launch Popover
      </Button>
      <Popover
        target='Popover123'
        trigger='click'>
        <PopoverHeader>Cart</PopoverHeader>
        <PopoverBody>
          <Cart />
        </PopoverBody>
      </Popover>
    </div>
  );
}
